INSERT INTO `message` VALUES (1,'在家乌冬','thekey0058@163.com','这是个人展示网站，很多不完善，希望能给予一些支持或建议，谢谢访问。','M',0,'2015-03-10 02:57:36','14.216.217.119'),(2,'匿名君','thekey0058@163.com','2楼测试。。','R',1,'2015-03-10 02:58:08','14.216.217.119'),(3,'在家乌冬','tr@bjn.bn','手机留言，网站手机也可以展示的说。。','M',0,'2015-03-10 03:17:00','112.97.38.207'),(4,'在家乌冬','thekey0058@163.com','文章可能会一点点的增加，个人还是在自身允许的情况下来丰富这个网站的。。','M',0,'2015-03-10 15:29:13','14.216.241.41'),(5,'匿名君','thekey0058@163.com','网站环境只有100M，虽然同IP并发数没有限制，不过应该能承受一般的压力测试吧，大概。','M',0,'2015-03-20 14:18:43','203.69.59.194'),(6,'在家乌冬','thekey0058@163.com','由于使用GoogleAnalytics限制，无法连接到Google的用户留言会被被等待而限制了。','R',5,'2015-03-20 14:20:58','203.69.59.194'),(7,'匿名君','thekey0058@163.com','网站里使用Google的有统计GA以及注册码的reCAPTCHA(搁置)，都限制于网络。','R',5,'2015-03-20 14:30:35','14.216.245.155'),(8,'在家乌冬','thekey0058@163.com','注释GA，20150320..','R',5,'2015-03-20 14:31:29','14.216.245.155'),(9,'在家乌冬','thekey0058@163.com','造成不便，十分抱歉，感觉都是自言自语的T_T||||','R',5,'2015-03-20 14:32:56','14.216.245.155'),(10,'匿名君','thekey0058@163.com','空间大小限制，所以文章都是写在专业网站，这里就好比作作品索引。。','R',4,'2015-03-20 14:36:04','14.216.245.155');
